const initState = {
    posts: ["hello"]
}

const loadData = () => {
    fetch("https://haven-1564356678440.firebaseio.com/Apartments.json").then(res => res.json())
    .then(
        () => {
            this.setState({
                posts: ['hello', 'jk']
            })
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
            this.setState({
            isLoaded: true,
            error
            });
        }
    )
}


const propertyReducer = (state = initState, action) => {
    loadData()
    return state;
}

export default propertyReducer;
